Input: Five years ago,  a computer that worked half as fast as a current computer cost twice as much money.  The current computer's speed to price ratio is what percent of the older computer's speed to price ratio?  Choices: a) 20  b) 400  c) 32  d) \\frac{2 }{5 } 
 Output:
 First,  let's denote the current computer's speed as S  and its price as P .  According to the problem,  the older computer's speed was half as fast,  so it was S / 2 .  The older computer's price was twice as much,  so it was 2 P .
 Now,  we need to find the speed to price ratio for both computers.  For the current computer,  the ratio is S  ÷ P .  For the older computer,  the ratio is ( S / 2 ) ÷ ( 2 P ) = S  ÷ 4 P .
 To find the percentage of the current computer's ratio compared to the older computer's ratio,  we divide the current ratio by the older ratio and multiply by 100 : ( S  ÷ P ) ÷ ( S  ÷ 4 P ) * 100 = ( 4 P  ÷ P ) * 100 = 4 * 100 = 400 .
 Therefore,  the correct answer is {'sol': 'b'}

Input: Suppose that we roll two fair 6 -sided dice.  What is the probability that the two numbers rolled sum to 4?  Choices: a) \\frac{1 }{4 } b) \\frac{1 }{12 } c) \\frac{1 }{3 } d) \\frac{1 }{9 } 
 Output:
 First,  I need to determine the total number of possible outcomes when rolling two dice.  Since each die has 6  sides,  the total number of outcomes is 6  * 6  = 36 .
 Next,  I need to find the number of outcomes where the sum of the two dice is 4.  The possible combinations are (1,3), (2,2), and (3,1).  So,  there are 3  outcomes where the sum is 4.
 To find the probability,  I divide the number of successful outcomes by the total number of outcomes: 3  ÷ 36  = 1  ÷ 12 .
 Therefore,  the correct answer is {'sol': 'b'}
